import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  const featuredProducts = [
    {
      id: 1,
      name: 'Dana Kuşbaşı',
      price: '680,00₺',
      image: '/images/dana-kusbasi.jpg'
    },
    {
      id: 2,
      name: 'Dana Kavurma',
      price: '95,00₺',
      image: '/images/dana-kavurma.jpg'
    },
    {
      id: 3,
      name: 'Steak Burger',
      price: '230,00₺',
      image: '/images/steak-burger.jpg'
    },
    {
      id: 4,
      name: 'Kasap Köfte',
      price: '210,00₺',
      image: '/images/kasap-kofte.jpg'
    }
  ];

  return (
    <div>
      {/* Hero Section */}
      <section className="hero">
        <div className="hero-content">
          <h1>Premium Et Ürünleri</h1>
          <p>En kaliteli et ürünleri ve kasap hizmetleri ile hizmetinizdeyiz.</p>
          <Link to="/products" className="btn btn-primary">Ürünlerimizi İncele</Link>
        </div>
      </section>

      {/* Featured Products */}
      <section className="products">
        <div className="container">
          <h2 className="section-title">Öne Çıkan Ürünlerimiz</h2>
          <div className="product-grid">
            {featuredProducts.map(product => (
              <div key={product.id} className="product-card">
                <img src={product.image} alt={product.name} className="product-image" />
                <div className="product-info">
                  <h3 className="product-title">{product.name}</h3>
                  <p className="product-price">{product.price}</p>
                </div>
              </div>
            ))}
          </div>
          <div style={{ textAlign: 'center', marginTop: '2rem' }}>
            <Link to="/products" className="btn btn-primary">Tüm Ürünlerimiz</Link>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
